import React from 'react';
import FormsPanel from '../forms-panel';
import { CellList } from '../cell-list';
import { styled, createGlobalStyle } from 'styled-components';

const AppWrapper = styled.div`
  background-color: #67809F;
`;

const App = () => {
  return (
    <AppWrapper>
      <FormsPanel />
      <CellList />
    </AppWrapper>
  )
};

export default App;
